import React from 'react';

export default function Certifications() {
  return (
    <section id="certifications" data-aos="fade-up">
      <h2>Certifications</h2>
      <ul>
        <li>Python for Data Science - NPTEL</li>
        <li>Business & Communication Skills - NPTEL</li>
        <li>Data Visualization Program - Forage</li>
      </ul>
    </section>
  );
}
